import React from 'react';
import {connect} from 'react-redux';
import CollectionPreview from '../../components/preview-collection-component/collection-preview.component'
import shopSelectorCollections from '../../redux/shop/shop.selector'

function ShopPage({shopSelectorCollections}) {
    return (
    <div className="shop-page">
        {
            shopSelectorCollections.map(({id, ...otherCollectionProps}) => (
                <CollectionPreview key={id} 
                {...otherCollectionProps} />
            ))
        }
    </div>
)
}

const MapStateToProps = state => ({
    shop: shopSelectorCollections(state)
})

export default connect(MapStateToProps)(ShopPage);
